#define _CRT_SECURE_NO_WARNINGS
#include <stdio.h>

int main(void)
{
	double larger, smaller;
	double area;
	double PI = 3.14159;

	printf("Larger:\n");
	scanf("%lf", &larger);

	printf("Smaller:\n");
	scanf("%lf", &smaller);

	area = PI * (larger*larger - smaller*smaller);
	printf("Area: %.3f cm^2", area);

	return 0;
}
